  [],\n\t\"num_tags\": 0,\n\t\"name\": \"sensitivity-of-coastal-environments-and-wildlife-to-spilled-oil-florida-panhandle-reptiles-rept\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains sensitive biological
  resource data for sea turtles and select estuarine/freshwater reptiles for the Florida
  Panhandle. Vector polygons in this data set represent sea turtle and select estuarine/freshwater
  reptile distribution. Species specific abundance, seasonality, status, life history,
  and source information are stored in relational data tables (described below) designed
  to be used in conjunction with this spatial data layer. This data set comprises
  a portion of the ESI data for Florida Panhandle. ESI data characterize the marine
  and coastal environments and wildlife by their sensitivity to spilled oil. The ESI
  data include information for three main components: shoreline habitats, sensitive
  biological resources, and human-use resources. See also the REPTPT (Reptile Points)
  data layer, part of the larger Florida Panhandle ESI database, for additional reptile
  information.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
